def kth_smallest_prime(arr, k):
    primes = []
    for num in arr:
        if num > 1:
            for i in range(2, num):
                if num % i == 0:
                    break
            else:
                primes.append(num)
    primes.sort()
    if len(primes) > k:
        return primes[k - 1]
